import { useState } from "react";
import './App.css';
import Error from './error/error.js';
import Login from './login/login.js'
import NavBar from './navbar/NavBar.js';

function App() {
  const [error, setError] = useState(0);
  return (
    <div className="App">
      <header>
        <NavBar/>
      </header>
      {(error > 0) && <Error error={error} setError={(err) => setError(err)}/>}
      <Login setError={(err) => setError(err)}/>
    </div>
  );
}

export default App;
